INSERT INTO `products` (`productID`, `productImage`, `productTitle`, `productCategory`, `productDescription`, `productMaterial`, `productPrice`, `productViews`, `productVisible`) VALUES
(29, , 'Статуэтка «Анубис»', 3, 'В Древнем Египте существовало божество, в ведении которого было все, связанное со смертью: его можно увидеть, взглянув на статуэтку «Анубис – проводник в загробный мир». Анубис имеет человеческое тело и голову дикой собаки. Помимо препровождения людей в загробный мир, Анубис занимался лекарствами и ядами. Этому загадочному и необычному существу посвящено не слишком много строк, но кое-что можно узнать из «Книги мертвых». На статуэтке бог Анубис изображен в виде мускулистого мужчины с длинным посохом. На нем много старинных украшений, выполненных в «египетской» цветовой гамме – сочетании золотого и синего цветов. Собачьи уши на голове божества украшены множеством золотых колец.\r\n\r\nРазмер(ВхШхД): 25.5х9х17.\r\nЦвет: бронза.\r\nВес: 550 г.', 'полистоун', 4200, 5, '1');
INSERT INTO `products` (`productID`, `productImage`, `productTitle`, `productCategory`, `productDescription`, `productMaterial`, `productPrice`, `productViews`, `productVisible`) VALUES
(30, , 'Копилка «Ежонок»', 8, 'Вес : 320 г.\r\nРазмер: 15 см.', 'Гипс', 119, 3, '1');
INSERT INTO `products` (`productID`, `productImage`, `productTitle`, `productCategory`, `productDescription`, `productMaterial`, `productPrice`, `productViews`, `productVisible`) VALUES
(31, , 'Статуэтка  «Слон»', 3, 'Bruno Costenaro представляет большой выбор поистине роскошных предметов для украшения интерьера.  Изделия выполнены в лучших итальянских традициях с использованием  самых качественных материалов и красок, краски используемые для позолоты содержат золото. Все изделия изготавливаются коллекциями, что очень удобно для обстановки комнаты или всего дома .\r\n\r\nРазмер(ВхШхД): 40х25х37\r\nДекор: золото 24-карата\r\nБренд: Bruno Costenaro', 'керамика', 17600, 6, '1');
INSERT INTO `products` (`productID`, `productImage`, `productTitle`, `productCategory`, `productDescription`, `productMaterial`, `productPrice`, `productViews`, `productVisible`) VALUES
(33, , 'Набор фигур «6 обезьянок»', 7, 'Размер(ВхШхД): 4х2х5 см.\r\nКол-во: 6 шт.', 'фарфор', 245, 2, '1');
INSERT INTO `products` (`productID`, `productImage`, `productTitle`, `productCategory`, `productDescription`, `productMaterial`, `productPrice`, `productViews`, `productVisible`) VALUES
(34, , 'Набор фигур «Ангелочки»', 7, 'Высота: 6,5 см.\r\nКол-во: 2 шт.', 'фарфор', 165, 1, '1');
INSERT INTO `products` (`productID`, `productImage`, `productTitle`, `productCategory`, `productDescription`, `productMaterial`, `productPrice`, `productViews`, `productVisible`) VALUES
(35, , 'Фигура «Три совы»', 3, 'Размер: 15х10 см.', 'Полистоун', 270, 3, '1');
INSERT INTO `products` (`productID`, `productImage`, `productTitle`, `productCategory`, `productDescription`, `productMaterial`, `productPrice`, `productViews`, `productVisible`) VALUES
(36, , 'Амулет «Абракадабра»', 1, 'Магическая гностическая формула (ок. I в. н.э.). Берёт начало в традиции «Alikwot» – воспевания звуков, которые своими вибрациями увлекают в возвышенные состояния духа (трансы) и очищают. Абракадабра, написанная и выговариваемая «в системе исчезания» – от полного названия до одной буквы, – удаляет болезни, злую участь, нищету и все злые энергии. При ношении амулета этому способствует форма маятника и гравировка на нём.', 'металл', 270, 2, '1');
INSERT INTO `products` (`productID`, `productImage`, `productTitle`, `productCategory`, `productDescription`, `productMaterial`, `productPrice`, `productViews`, `productVisible`) VALUES
(37, , 'Амулет «Трефот»', 1, 'Исполняет желания, даёт мудрость, духовное и физическое совершенство. Заключает в себе силу Могучего Светила и имеет отношение к власти. Приносит удачу и помогает добиться желаемого результата. Дарит неиссякаемый оптимизм, помогает в душевной и телесной трансформации и мудрости. Знак служит защитным амулетом от всех чёрных сил и проявления нечистых побуждений.', 'Олово', 190, 3, '1');
INSERT INTO `products` (`productID`, `productImage`, `productTitle`, `productCategory`, `productDescription`, `productMaterial`, `productPrice`, `productViews`, `productVisible`) VALUES
(38, , 'Амулет «Алатырь-Звезда»', 1, 'Алатырь – древнейший талисман, соединяющий мужскую и женскую энергии. Он наделяет плодородием, способствует духовному и телесному развитию. Охраняет женщину в период беременности, хранит родовые отношения, благополучие семьи. Служит «путеводной звездой». Поэтому Алатырь всегда использовался как амулет для путешественников, моряков, торговцев. Так же он является и оберегом в духовных странствиях. Звезда Алатырь, как символ, встречается в культуре многих народов.', 'олово', 240, 4, '1');
INSERT INTO `products` (`productID`, `productImage`, `productTitle`, `productCategory`, `productDescription`, `productMaterial`, `productPrice`, `productViews`, `productVisible`) VALUES
(39, , 'Брелок «Скандинавский нож»', 2, 'В течение тысячелетий нож был не просто орудием убийства, но и символом мужества и доблести, неизменным спутником воина и предметом его гордости. \r\n\r\nВысота: 6 см.', 'нержавеющая сталь', 400, 1, '1');
INSERT INTO `products` (`productID`, `productImage`, `productTitle`, `productCategory`, `productDescription`, `productMaterial`, `productPrice`, `productViews`, `productVisible`) VALUES
